CREATE TABLE PLAYSTORE_APPS(
   App_Name        VARCHAR(1940) NOT NULL
  ,Developer_ID    VARCHAR(500) NOT NULL
  ,App_ID          INTEGER  NOT NULL PRIMARY KEY 
  ,Category        VARCHAR(1900) NOT NULL
  ,No_Of_Downloads VARCHAR(1400) NOT NULL
  ,Release_Dat     DATE  NOT NULL
  ,Price           NUMERIC(6,2) NOT NULL
);
